def is_prime(n):
    if n == 1:
        return False
    if n == 2:
        return True
    if n % 2 == 0:
        return False
    for i in range(3, int(n ** 0.5) + 1, 2):
        if n % i == 0:
            return False
    return True


def prime_row(matrix):
    for row in matrix:
        if all(is_prime(x) for x in row):
            return True
    return False


def prime_col(matrix):
    for j in range(len(matrix[0])):
        if all(is_prime(matrix[i][j]) for i in range(len(matrix))):
            return True
    return False


def solve(matrix):
    moves = 0
    if prime_row(matrix):
        return 0
    if prime_col(matrix):
        return 0
    for i in range(len(matrix)):
        for j in range(len(matrix[0])):
            if not is_prime(matrix[i][j]):
                matrix[i][j] += 1
                moves += 1
                if prime_row(matrix) or prime_col(matrix):
                    return moves
    return moves


