class Dinic:

    def __init__(self, v, e):
        self.v = v
        self.e = e
        self.graph = [[] for _ in range(v)]
        self.level = None
        self.iter = None

    def addEdge(self, fromv, tov, cap):
        forward = [tov, cap, None]
        backward = [fromv, 0, forward]
        self.graph[fromv].append(forward)
        self.graph[tov].append(backward)

    def bfs(self, s, t):
        self.level = [None] * self.v
        self.level[s] = 0
        q = [s]
        i = 0
        while i < len(q):
            v = q[i]
            for edge in self.graph[v]:
                if edge[2] is None and self.level[edge[0]] is None:
                    self.level[edge[0]] = self.level[v] + 1
                    q.append(edge[0])
            i += 1
        return self.level[t] is not None

    def dfs(self, v, t, f):
        if v == t:
            return f
        for i in range(self.iter[v], len(self.graph[v])):
            self.iter[v] = i
            edge = self.graph[v][i]
            if edge[2] is not None and self.level[v] < self.level[edge[0]]:
                d = self.dfs(edge[0], t, min(f, edge[1]))
                if d > 0:
                    edge[1] -= d
                    self.graph[edge[0]][self.graph[edge[0]].index(edge)][1] += d
                    return d
        return 0

    def maxFlow(self, s, t):
        maxflow = 0
        while self.bfs(s, t):
            self.iter = [0] * self.v
            while True:
                d = self.dfs(s, t, float('inf'))
                if d == 0:
                    break
                maxflow += d
        return maxflow


