class SegTree:
    def __init__(self, arr, default=0, func=lambda x, y: x + y):
        self.n = len(arr)
        self.default = default
        self.func = func
        self.tree = [default] * (4 * self.n)
        self.lazy = [default] * (4 * self.n)
        self.build(arr)

    def build(self, arr):
        for i in range(self.n):
            self.tree[i + self.n - 1] = arr[i]
        for i in range(self.n - 2, -1, -1):
            self.tree[i] = self.func(self.tree[2 * i + 1], self.tree[2 * i + 2])

    def update(self, i, val):
        i += self.n - 1
        self.tree[i] = val
        while i > 0:
            i = (i - 1) // 2
            self.tree[i] = self.func(self.tree[2 * i + 1], self.tree[2 * i + 2])

    def query(self, a, b):
        a += self.n - 1
        b += self.n - 1
        res = self.default
        while a <= b:
            if a % 2 == 1:
                res = self.func(res, self.tree[a])
                a += 1
            if b % 2 == 0:
                res = self.func(res, self.tree[b])
                b -= 1
            a //= 2
            b //= 2
        return res

    def __call__(self, a, b):
        return self.query(a, b)


