class DSU:

    def __init__(self, n):
        self.parent = list(range(n))
        self.rank = [1] * n
        self.size = [1] * n

    def find(self, x):
        if self.parent[x] != x:
            self.parent[x] = self.find(self.parent[x])
            self.rank[x] = self.rank[self.parent[x]]
            self.size[x] = self.size[self.parent[x]]
        return self.parent[x]

    def union(self, x, y):
        xr, yr = self.find(x), self.find(y)
        if xr == yr:
            return False
        if self.rank[xr] > self.rank[yr]:
            self.parent[yr] = xr
            self.size[xr] += self.size[yr]
        elif self.rank[xr] < self.rank[yr]:
            self.parent[xr] = yr
            self.size[yr] += self.size[xr]
        else:
            self.parent[yr] = xr
            self.rank[xr] += 1
            self.size[xr] += self.size[yr]
        return True


