import math


def isprime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i = i + 6
    return True


def primefacs(n):
    i = 2
    factors = []
    while i * i <= n:
        if n % i:
            i = i + 1
        else:
            n //= i
            factors.append(i)
    if n > 1:
        factors.append(n)
    return factors


def factorization(n):
    factors = {}
    for i in range(2, int(math.sqrt(n)) + 1):
        while n % i == 0:
            if i in factors:
                factors[i] += 1
            else:
                factors[i] = 1
            n //= i
    if n > 1:
        factors[n] = 1
    return factors


def find_next_squarefree(n):
    factors = factorization(n)
    for i in range(2, n):
        if i % n != 0:
            if isprime(i):
                if i ** 2 not in factors:
                    return i
    return -1


